script: |
  super -f tsv -I q469.sql > q469.out

vector: true

inputs:
  - name: q469.sql
    data: |
      SELECT abs(b-c)
      FROM t1
      WHERE c>d
      AND d NOT BETWEEN 110 AND 150
      AND a>b
      ORDER BY 1;
  - name: t1

outputs:
  - name: q469.out
    data: |
      1
      2
      2
      3
      3
      4
